import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
// import otpnew from '../image/otpnew.png';
import otpnew from '../image/otpnew.png';

const Otp = () => {
  const [otpNumber1, setOtpNumber1] = useState('');
  const [otpNumber2, setOtpNumber2] = useState('');
  const [otpNumber3, setOtpNumber3] = useState('');
  const [otpNumber4, setOtpNumber4] = useState('');
  const [otpNumber5, setOtpNumber5] = useState('');
  const [otpNumber6, setOtpNumber6] = useState('');

  const navigate = useNavigate();

  const otpVerification = async (e) => {
    e.preventDefault();
    let inputData =
      otpNumber1 +
      otpNumber2 +
      otpNumber3 +
      otpNumber4 +
      otpNumber5 +
      otpNumber6;
    await fetch('http://localhost:1731/user/verify-otp', {
      method: 'POST',
      headers: {
        'content-type': 'application/json',
        Authorization: 'Bearer' + ' ' + sessionStorage.token,
      },
      body: JSON.stringify({
        otp: inputData,
      }),
    }).then(async (res) => {
      if (res.status === 200) {
        if (sessionStorage.isOrgId === 'false') {
          navigate('/org');
        } else {
          navigate('/dashboard');
        }
      }
    });
  };
  return (
    <>
      <form>
        <div className="flex min-h-full h-screen">
          <div className="flex flex-1 flex-col w-1/2 justify-center border  ">
            <div className="mx-auto my-10 lg:w-3/5  2xl:w-3/6 lg:w-100 bg-white border rounded-2xl">
              <div className="grid grid-cols-2">
                <div className="self-center">
                  <img src={otpnew} alt="rlog" />
                </div>
                <div className=" bg-RBlue flex items-center p-12 rounded-r-2xl">
                  <div className="w-full">
                    <h2 className=" textxl  font-bold text-white">
                      OTP Verification
                    </h2>
                    <p className="text-white text-md">
                      Enter OTP sent to Registered mail ID
                    </p>
                    <div className="space-y-2 mt-3">
                      <div>
                        <div>
                          <input
                            type="text"
                            className="border rounded-lg  mt-2 placeholder-RBlue w-full p-1 placeholder:text-xs px-3 focus:outline-none focus:border-blue-500 "
                            placeholder="*********"
                          />
                        </div>
                        <p className="text-white text-md py-2">
                          Didn’t receive OTP code ?
                        </p>
                        <span className="text-white text-md">
                          <a href="#"> Resend Code</a>
                        </span>
                      </div>
                      <div>
                        <button
                          type="submit"
                          className="bg-RButton text-RText text-sm font-bold w-full py-2 px-4 rounded mt-4 "
                        >
                          Verify & Proceed
                        </button>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </form>
      <div className="flex flex-col justify-center items-center h-screen">
        <div>
          <input
            type="text"
            name="otp_number1"
            value={otpNumber1}
            onChange={(e) => setOtpNumber1(e.target.value)}
            maxLength="1"
            className="w-8 h-10 text-center border border-gray-300 rounded bg-Otpcolor  ml-2 "
          />
          <input
            type="text"
            name="otp_number2"
            value={otpNumber2}
            onChange={(e) => setOtpNumber2(e.target.value)}
            maxLength="1"
            className="w-8 h-10 text-center border border-gray-300 rounded bg-Otpcolor  ml-2 "
          />
          <input
            type="text"
            name="otp_number3"
            value={otpNumber3}
            onChange={(e) => setOtpNumber3(e.target.value)}
            maxLength="1"
            className="w-8 h-10 text-center border border-gray-300 rounded bg-Otpcolor  ml-2 "
          />
          <input
            type="text"
            name="otp_number4"
            value={otpNumber4}
            onChange={(e) => setOtpNumber4(e.target.value)}
            maxLength="1"
            className="w-8 h-10 text-center border border-gray-300 rounded bg-Otpcolor  ml-2 "
          />
          <input
            type="text"
            name="otp_number5"
            value={otpNumber5}
            onChange={(e) => setOtpNumber5(e.target.value)}
            maxLength="1"
            className="w-8 h-10 text-center border border-gray-300 rounded bg-Otpcolor  ml-2 "
          />
          <input
            type="text"
            name="otp_number6"
            value={otpNumber6}
            onChange={(e) => setOtpNumber6(e.target.value)}
            maxLength="1"
            className="w-8 h-10 text-center border border-gray-300 rounded bg-Otpcolor  ml-2 "
          />
        </div>
        <div className="mt-5">
          <button
            onClick={otpVerification}
            className="bg-blue-500 text-white px-3 py-1 rounded-lg"
          >
            Submit
          </button>
        </div>
      </div>
    </>
  );
};

export default Otp;
